window.bookSummaryJSON = "<p>Charlie Trace, professional thief, is no stranger to deceit and violence. But nothing in his life on the knife-edge of London's underworld could prepare him for the horror of Demogorgon.</p> <p>It is centuries old. Satan is its lord and master. It walks the earth in the guise of a man, but it is not a man: it is the very essence of evil.</p> <p>Across many years and nations, Demogorgon has sown the seeds of hell. Now, it is calling its children home. Demogorgon's power grows with every soul it devours - and if Charlie Trace can't stop it, he will be its next victim!</p>"; 
